const LIGHT = {
  noPoi: [
    {
      featureType: 'poi',
      stylers: [{ visibility: 'off' }]
    }
  ],
  poi: [
    {
      featureType: 'poi',
      stylers: [{ visibility: 'on' }]
    }
  ],
  scaleColor: '#000'
}

export default LIGHT
